export class Book {
  constructor(
  // tslint:disable-next-line: variable-name
  _id, name, author, published, description, price) {
    this._id = _id;
    this.name = name;
    this.author = author;
    this.published = published;
    this.description = description;
    this.price = price;
  }
  toString() {
    return `
    Book
    -------------------------------
    Name       : ${this.name}
    Author     : ${this.author}
    Published  : ${this.published}
    Description: ${this.description}
    Price      : ${this.price}
    -------------------------------
    `;
  }
}
